INSERT INTO `catalogs` VALUES (1,'2048','{\n    \"Services\": {\n        \"2048\": {\n            \"Name\": \"2048\",\n            \"Labels\": {\n                \"name\": \"2048\"\n            },\n            \"TaskTemplate\": {\n                \"ContainerSpec\": {\n                    \"Image\": \"blackicebird/2048\"\n                }\n            },\n            \"Networks\": [\n                \"ingress\"\n                ],\n            \"EndpointSpec\": {\n                \"Mode\": \"vip\",\n                \"Ports\": [\n                {\n                    \"Name\": \"pbport\",\n                    \"Protocol\": \"tcp\",\n                    \"TargetPort\": 80,\n                    \"PublishedPort\": 8000\n                }\n                ]\n            }\n        }\n    },\n    \"Version\": \"1\"\n}\n\n','2048是一款比较流行的数字游戏，最早于2014年3月20日发行。原版2048首先在GitHub上发布，原作者是Gabriele Cirulli，后被移植到各个平台。这款游戏是基于 1024 和 小3传奇 的玩法开发而成的新型数字游戏。\n\n每次可以选择上下左右其中一个方向去滑动，每滑动一次，所有的数字方块都会往滑动的方向靠拢外，系统也会在空白的地方乱数出现一个数字方块，相同数字的方块在靠拢、相撞时会相加。不断的叠加最终拼凑出2048这个数字就算成功。\n','data:image/png;base64,',0,0),(2,'mysql','{\n  \"Services\": {\n    \"mysql\": {\n      \"Name\": \"mysql\",\n      \"Labels\": {\n        \"name\": \"mysql\"\n      },\n      \"TaskTemplate\": {\n        \"ContainerSpec\": {\n          \"Image\": \"mysql\",\n          \"Labels\": {\n            \"name\": \"mysql\"\n          },\n          \"Env\": [\n            \"MYSQL_ROOT_PASSWORD=foobar\"\n            ]\n        },\n        \"Resources\": {\n          \"Limits\": {\n            \"NanoCPUs\": 10000000,\n            \"MemoryBytes\": 4194304\n          },\n          \"Reservations\": {\n            \"NanoCPUs\": 10000000,\n            \"MemoryBytes\": 4194304\n          }\n        },\n        \"RestartPolicy\": {\n          \"Condition\": \"none\",\n          \"Delay\": 3000000000,\n          \"MaxAttempts\": 1,\n          \"Window\": 3000000000\n        },\n        \"Placement\": {\n          \"Constraints\": []\n        },\n        \"LogDriver\": {\n          \"Name\": \"json-file\"\n        }\n      },\n      \"Mode\": {\n        \"Replicated\": {\n          \"Replicas\": 1\n        }\n      },\n      \"UpdateConfig\": null,\n      \"EndpointSpec\": {\n        \"Mode\": \"vip\",\n        \"Ports\": [\n          {\n            \"Name\": \"testport\",\n            \"Protocol\": \"tcp\",\n            \"TargetPort\": 3306,\n            \"PublishedPort\": 3306\n          }\n        ]\n      }\n    }\n  }\n}\n\n\n','MySQL是一个关系型数据库管理系统，由瑞典MySQL AB 公司开发，目前属于 Oracle 旗下公司。MySQL 最流行的关系型数据库管理系统，在 WEB 应用方面MySQL是最好的 RDBMS (Relational Database Management System，关系数据库管理系统) 应用软件之一。\n\nMySQL是一种关联数据库管理系统，关联数据库将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。\nMySQL所使用的 SQL 语言是用于访问数据库的最常用标准化语言。MySQL 软件采用了双授权政策，它分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，一般中小型网站的开发都选择 MySQL 作为网站数据库。\n\n由于其社区版的性能卓越，搭配 PHP 和 Apache 可组成良好的开发环境。\n\n','data:image/png;base64,',0,0),(3,'mywebsql','{\n    \"Services\": {\n        \"mysql\": {\n        \"Name\": \"mysql\",\n            \"Labels\": {\n                \"name\": \"mysql\"\n            },\n            \"TaskTemplate\": {\n                \"ContainerSpec\": {\n                    \"Image\": \"mysql\",\n                    \"Labels\": {\n                        \"name\": \"mysql\"\n                    },\n                    \"Env\": [\n                        \"MYSQL_ROOT_PASSWORD=111111\"\n                        ],\n                    \"User\": \"root\"\n                },\n                \"RestartPolicy\": {\n                    \"Condition\": \"none\",\n                    \"Delay\": 3000000000,\n                    \"MaxAttempts\": 1,\n                    \"Window\": 3000000000\n                },\n                \"LogDriver\": {\n                    \"Name\": \"json-file\"\n                }\n            },\n            \"Mode\": {\n                \"Replicated\": {\n                    \"Replicas\": 1\n                }\n            },\n            \"UpdateConfig\": null,\n            \"Networks\": [\n                \"ingress\"\n                ],\n            \"EndpointSpec\": {\n                \"Mode\": \"vip\"\n            }\n        },\n        \"mywebsql\": {\n            \"Name\": \"mywebsql\",\n            \"Labels\": {\n                \"mywebsql\": \"mywebsql\"\n            },\n            \"TaskTemplate\": {\n                \"ContainerSpec\": {\n                    \"Image\": \"quantumobject/docker-mywebsql\",\n                    \"Labels\": {\n                        \"name\": \"mywebsql\"\n                    },\n                    \"User\": \"root\"\n                },\n                \"RestartPolicy\": {\n                    \"Condition\": \"none\",\n                    \"Delay\": 3000000000,\n                    \"MaxAttempts\": 1,\n                    \"Window\": 3000000000\n                },\n                \"LogDriver\": {\n                    \"Name\": \"json-file\"\n                }\n            },\n            \"Mode\": {\n                \"Replicated\": {\n                    \"Replicas\": 1\n                }\n            },\n            \"UpdateConfig\": null,\n            \"Networks\": [\n                \"ingress\"\n                ],\n            \"EndpointSpec\": {\n                \"Mode\": \"vip\",\n                \"Ports\": [\n                {\n                    \"Name\": \"testport\",\n                    \"Protocol\": \"tcp\",\n                    \"TargetPort\": 80,\n                    \"PublishedPort\": 8000\n                }\n                ]\n            }\n        }\n    },\n    \"Version\": \"1\"\n}\n\n','MySQL是一个关系型数据库管理系统，由瑞典MySQL AB 公司开发，目前属于 Oracle 旗下公司。MySQL 最流行的关系型数据库管理系统，在 WEB 应用方面MySQL是最好的 RDBMS (Relational Database Management System，关系数据库管理系统) 应用软件之一。\n\nMySQL是一种关联数据库管理系统，关联数据库将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。\nMySQL所使用的 SQL 语言是用于访问数据库的最常用标准化语言。MySQL 软件采用了双授权政策，它分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，一般中小型网站的开发都选择 MySQL 作为网站数据库。\n\n由于其社区版的性能卓越，搭配 PHP 和 Apache 可组成良好的开发环境。\n\nMyWebSql是一个基于Web的MySQL数据库管理客户端，支持多种语言。它除了操作表格数据外，MyWebSql 还可以对包括视图，存储过程，触发器和函数在内的对象进行控制。支持数据和查询结果的导入\\导出。MyWebSql还内置一个带语法着色功能的SQL编辑器\n','data:image/png;base64,',0,0),(4,'wordpress','{\n    \"Services\": {\n        \"mysql\": {\n            \"Name\": \"mysql\",\n            \"Labels\": {\n                \"name\": \"mysql\"\n            },\n            \"TaskTemplate\": {\n                \"ContainerSpec\": {\n                    \"Image\": \"mysql\",\n                    \"Labels\": {\n                        \"name\": \"mysql\"\n                    },\n                    \"Env\": [\n                        \"MYSQL_ROOT_PASSWORD=wordpress\",\n                        \"MYSQL_PASSWORD=wordpress\",\n                        \"MYSQL_USER=wordpress\",\n                        \"MYSQL_DATABASE=wordpress\"\n                    ],\n                    \"User\": \"root\"\n                },\n                \"RestartPolicy\": {\n                    \"Condition\": \"none\",\n                    \"Delay\": 3000000000,\n                    \"MaxAttempts\": 1,\n                    \"Window\": 3000000000\n                },\n                \"LogDriver\": {\n                    \"Name\": \"json-file\"\n                }\n            },\n            \"Mode\": {\n                \"Replicated\": {\n                    \"Replicas\": 1\n                }\n            },\n            \"UpdateConfig\": null,\n            \"Networks\": [\n                \"ingress\"\n            ]\n        },\n        \"wordpress\": {\n            \"Name\": \"wordpress\",\n            \"Labels\": {\n                \"wordpress\": \"wordpress\"\n            },\n            \"TaskTemplate\": {\n                \"ContainerSpec\": {\n                    \"Image\": \"wordpress\",\n                    \"Labels\": {\n                        \"name\": \"wordpress\"\n                    },\n                    \"Env\": [\n                        \"WORDPRESS_DB_HOST=mysql:3306\",\n 